class Main {
    public static void main(String[] args) {
        System.out.println();
        BTree tree = new BTree(3);

        Timer timer = new Timer(tree);

        System.out.println("Inserting sorted elements: " + timer.sortedTimer(tree::add));
        System.out.println("Balancing sorted elements: " + timer.balancingTimer());

        BTree tree2 = new BTree(3);
        Timer timer2 = new Timer(tree2);

        System.out.println("Inserting random elements: " + timer2.randomTimer(tree2::add));
        System.out.println("Balancing random elements: " + timer2.balancingTimer());
        System.out.println("Searching: " + timer2.sortedTimer(tree2::search));
        System.out.println("Deleting: " + timer2.sortedTimer(tree2::delete));
    }
}

